import React, {PureComponent} from 'react';
import PropTypes from 'prop-types';

class AddTables extends PureComponent {
    render() {
        return (
            <div>
                <button className={"button"}>Add Table</button>
            </div>
        );
    }
}

AddTables.propTypes = {};

export default AddTables;
